import { Component, ComponentFactoryResolver } from '@angular/core';
import { AddEmployeeComponent } from '../add-employee/add-employee.component';
import { ApiManagementService } from '../Service/api-management.service';

@Component({
  selector: 'app-employee-list',
  templateUrl: './employee-list.component.html',
  styleUrls: ['./employee-list.component.css']
})
export class EmployeeListComponent {

  SingleEmployeeById:any={
    Fname:'',
    LName:'',
    Age:''
  }


  constructor(public service: ApiManagementService){}

  ngOnInit():void{


  }


  getEmployeeById(Id:any){
    this.service.getEmployeeById(Id.id).subscribe(response=>{
      this.SingleEmployeeById = response.detail[0]
    })

  }






}
